import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const FooterContainer = styled.footer`
  background: ${props => props.theme.colors.secondary};
  color: ${props => props.theme.colors.white};
  padding: 4rem 2rem 2rem;
`;

const FooterContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 3rem;
  margin-bottom: 3rem;
`;

const FooterSection = styled(motion.div)``;

const FooterTitle = styled.h3`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 1.5rem;
  margin-bottom: 1.5rem;
  color: ${props => props.theme.colors.primary};
`;

const FooterText = styled.p`
  line-height: 1.6;
  opacity: 0.8;
  margin-bottom: 1rem;
`;

const FooterLinks = styled.ul`
  list-style: none;
  display: flex;
  flex-direction: column;
  gap: 0.8rem;
`;

const FooterLink = styled(motion.li)`
  color: ${props => props.theme.colors.white};
  cursor: pointer;
  opacity: 0.8;
  transition: all 0.3s ease;

  &:hover {
    opacity: 1;
    color: ${props => props.theme.colors.primary};
    transform: translateX(5px);
  }
`;

const SocialLinks = styled.div`
  display: flex;
  gap: 1rem;
  margin-top: 1rem;
`;

const SocialLink = styled(motion.a)`
  width: 40px;
  height: 40px;
  background: linear-gradient(45deg, ${props => props.theme.colors.primary}, ${props => props.theme.colors.gold});
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  color: ${props => props.theme.colors.white};
  text-decoration: none;
  font-size: 1.2rem;
`;

const FooterBottom = styled.div`
  border-top: 1px solid rgba(255, 255, 255, 0.1);
  padding-top: 2rem;
  text-align: center;
  display: flex;
  justify-content: space-between;
  align-items: center;
  flex-wrap: wrap;
  gap: 1rem;

  @media (max-width: ${props => props.theme.breakpoints.mobile}) {
    flex-direction: column;
  }
`;

const Copyright = styled.p`
  opacity: 0.6;
`;

const PaymentMethods = styled.div`
  display: flex;
  gap: 1rem;
  align-items: center;
`;

const PaymentIcon = styled.div`
  padding: 0.5rem;
  background: ${props => props.theme.colors.white};
  border-radius: 5px;
  color: ${props => props.theme.colors.secondary};
  font-weight: 600;
  font-size: 0.8rem;
`;

const Footer = () => {
  const footerSections = [
    {
      title: 'Luxe Jewelry',
      content: (
        <>
          <FooterText>
            Crafting timeless elegance since 1998. We specialize in creating 
            exceptional jewelry pieces that celebrate life's most precious moments.
          </FooterText>
          <SocialLinks>
            <SocialLink
              href="#"
              whileHover={{ scale: 1.1, rotate: 5 }}
              whileTap={{ scale: 0.9 }}
            >
              📘
            </SocialLink>
            <SocialLink
              href="#"
              whileHover={{ scale: 1.1, rotate: -5 }}
              whileTap={{ scale: 0.9 }}
            >
              📷
            </SocialLink>
            <SocialLink
              href="#"
              whileHover={{ scale: 1.1, rotate: 5 }}
              whileTap={{ scale: 0.9 }}
            >
              🐦
            </SocialLink>
            <SocialLink
              href="#"
              whileHover={{ scale: 1.1, rotate: -5 }}
              whileTap={{ scale: 0.9 }}
            >
              💼
            </SocialLink>
          </SocialLinks>
        </>
      )
    },
    {
      title: 'Quick Links',
      content: (
        <FooterLinks>
          {['Home', 'Collections', 'About Us', 'Contact', 'Custom Design', 'Repairs'].map((link, index) => (
            <FooterLink
              key={link}
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
              whileHover={{ x: 5 }}
            >
              {link}
            </FooterLink>
          ))}
        </FooterLinks>
      )
    },
    {
      title: 'Collections',
      content: (
        <FooterLinks>
          {['Engagement Rings', 'Wedding Bands', 'Necklaces', 'Earrings', 'Bracelets', 'Watches'].map((link, index) => (
            <FooterLink
              key={link}
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
              whileHover={{ x: 5 }}
            >
              {link}
            </FooterLink>
          ))}
        </FooterLinks>
      )
    },
    {
      title: 'Customer Care',
      content: (
        <>
          <FooterText>📞 +1 (555) 123-4567</FooterText>
          <FooterText>✉️ info@luxejewelry.com</FooterText>
          <FooterText>📍 123 Luxury Avenue<br />Diamond District, NY 10001</FooterText>
          <FooterText>🕒 Mon-Sat: 10AM-8PM<br />Sun: 12PM-6PM</FooterText>
        </>
      )
    }
  ];

  return (
    <FooterContainer>
      <FooterContent>
        {footerSections.map((section, index) => (
          <FooterSection
            key={section.title}
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: index * 0.1 }}
          >
            <FooterTitle>{section.title}</FooterTitle>
            {section.content}
          </FooterSection>
        ))}
      </FooterContent>

      <FooterBottom>
        <Copyright>
          © 2024 Luxe Jewelry. All rights reserved. | Privacy Policy | Terms of Service
        </Copyright>
        
        <PaymentMethods>
          <span style={{ opacity: 0.6, marginRight: '1rem' }}>We Accept:</span>
          <PaymentIcon>VISA</PaymentIcon>
          <PaymentIcon>MC</PaymentIcon>
          <PaymentIcon>AMEX</PaymentIcon>
          <PaymentIcon>PAYPAL</PaymentIcon>
        </PaymentMethods>
      </FooterBottom>
    </FooterContainer>
  );
};

export default Footer;
